import React from 'react';
import './App.css';
import ReactNode from './ReactNode';
import { Provider } from './ReactDims';
import { useState, useEffect } from 'react';

const App=()=>{

const [data, setData] = useState([]);
  const generateData = ()=>{
    var data = [
      [{row:"32", column:"A", value:0},{row:"32", column:"B", value:1},{row:"32", column:"D", value:2}],
      [{row:"34", column:"A", value:3},{row:"34", column:"B", value:4},{row:"34", column:"D", value:5}],
      [{row:"36", column:"A", value:6},{row:"36", column:"B", value:7},{row:"36", column:"D", value:8}],
    ];
    let arr = []
    arr = data.map(row => (row.map(item => (item.value))));
    setData(arr);
    console.log(arr);
  };
  useEffect(()=>generateData(),[])

  return (
     <div className="myLayout">
      <div style={{gridArea: '1/2/2/4', display: 'flex', alignItems: 'center', justifyContent: 'center'}}>
        <div className="coolThing">
          <Provider>
            <ReactNode data={data}/>
          </Provider>
          </div>
      </div>
    </div>
  );
}

export default App;
